CREATE TABLE eplusi.enrollments
(
    enroll_id int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    youth_id int(11) NOT NULL,
    enroll_status_code int(11) NOT NULL,
    start_date date,
    end_date date,
    enroll_desc text,
    CONSTRAINT enrollments_youth_youth_id_fk FOREIGN KEY (youth_id) REFERENCES eplusi.youth (youth_id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT enrollments_enroll_status_enroll_status_code_fk FOREIGN KEY (enroll_status_code) REFERENCES code.enroll_status (enroll_status_code) ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE INDEX enrollments_youth_youth_id_fk ON eplusi.enrollments (youth_id);
CREATE INDEX enrollments_enroll_status_enroll_status_code_fk ON eplusi.enrollments (enroll_status_code);
